Conforme protocolo vigente, são admitidas para seguimento especializado as gestantes com doenças infecciosas nas seguintes condições:

Sífilis terciária;

Sífilis resistente ao tratamento com penicilina benzatina;

Presença de achados ecográficos sugestivos de sífilis congênita.

Em casos de resistência ao tratamento, é possível acionar a rede de apoio intersetorial para fortalecimento do cuidado, incluindo:

Encaminhamento para atendimento psicológico no âmbito municipal;

Comunicação ao Conselho Tutelar, quando houver risco ou negligência;

Ativação da equipe da Assistência Social para acompanhamento e suporte à gestante e ao feto.
Att.
